import React from "react";
import "./chart.css";
import {
  CartesianGrid,
  Line,
  LineChart,
  ResponsiveContainer,
  Tooltip,
  XAxis,
  YAxis,
} from "recharts";
import { UserData } from "../../Shared/dummyData";
export default function Chart(title, dataKey, grid) {
  const props = [...arguments];
  console.log(props[0].data);
  return (
    <div className="Chart">
      <h3 className="chartTitle">{props[0].title}</h3>
      {/* aspect means 4 unit for width 1 unit for height (if width 400 height 100) */}
      <ResponsiveContainer width="100%" aspect={4 / 1}>
        <LineChart data={props[0].data} className="chartAnalytics">
          <XAxis dataKey="name" stroke="#213f66"></XAxis>
          <YAxis stroke="#213f66"></YAxis>
          <Line
            type="monotone"
            dataKey={props[0].dataKey}
            stroke="#213f66"
          ></Line>
          <Tooltip></Tooltip> {/** to show info when hover over points */}
          {props[0].grid && <CartesianGrid stroke="#e0dfdf"></CartesianGrid>}
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}
